import './Home.css';


export const TEST = () => {
    return (
        <main>
        <h2>TEST</h2>
        <nav>
            
        <ul>
            <form action="http://localhost/soteria_cat_project/cat_backend/caseList/index.php" method="post" id="test">
                <label>GET DETAILS FOR 'APOLLO'</label>
                <input type='text' name='codename' value="APOLLO" />
    
                <label> </label>
                <button type='submit' name='action' value='Details'>POST</button>
            </form>
    
        </ul>
    
        
        </nav>
        </main>
      
    );
  };
